  // Script loader helper function
  function loadScript(url, onSuccess, onError) {
    const script = document.createElement('script');
    script.src = url;
    script.async = true;
    script.onload = onSuccess;
    script.onerror = function(e) {
      console.error("Script load error:", e);
      if (onError) onError(e);
    };
    document.head.appendChild(script);
  }
  
  // Updated ABI for SatoshisSecret_Chapter3 contract
  const contractABI = [
    // Mint function that requires payment
    "function mint(uint256 id, uint256 amount) public payable",
    // Balance checking function
    "function balanceOf(address account, uint256 id) public view returns (uint256)",
    // View function to get current mint price
    "function mintPrice() public view returns (uint256)"
  ];
  
  // Mint using the correct contract
  async function mintNFT(runtimeScene) {
    try {
      console.log("Starting NFT mint process...");
      if (!window.ethereum) {
        throw new Error("No Ethereum wallet found. Please install MetaMask.");
      }
      
      // Request account access
      await window.ethereum.request({ method: 'eth_requestAccounts' });
      console.log("Wallet connected!");
      
      const provider = new ethers.providers.Web3Provider(window.ethereum);
      const signer = provider.getSigner();
      const userAddress = await signer.getAddress();
      console.log("User address:", userAddress);
      
      // Updated contract address
      const contractAddress = "0x21f013474ECA2b4AC12d6e5A973b4d1Ec9345Ff0";
      const contract = new ethers.Contract(contractAddress, contractABI, signer);
      
      // Check balance of token ID 3
      const balance = await contract.balanceOf(userAddress, 3);
      if (balance.gt(0)) {
        console.log("You already own this NFT!");
        runtimeScene.getVariables().get("NFT_Miggles").setBoolean(true);
        return;
      }
      
      // Get current mint price
      const mintPrice = await contract.mintPrice();
      console.log("Current mint price:", ethers.utils.formatEther(mintPrice), "ETH");
      
      // Mint token with required payment
      console.log("Attempting to mint token ID 3...");
      const tx = await contract.mint(
        3, // Token ID
        1, // Amount to mint
        { value: mintPrice } // Send the required ETH
      );
      
      console.log("Mint transaction sent:", tx.hash);
const receipt = await tx.wait();
console.log("Transaction confirmed! Block number:", receipt.blockNumber);
runtimeScene.getVariables().get("NFT_Miggles").setBoolean(true);
runtimeScene.getVariables().get("Success_Mint_Miggles").setBoolean(true); // ✅ New success flag
      
    } catch (error) {
      console.error("Mint Error:", error);
      runtimeScene.getVariables().get("NFT_Miggles").setBoolean(false);
      runtimeScene.getVariables().get("Success_Mint_Miggles").setBoolean(false); // ❌ Ensures it's false if minting fails

        // Get the Mint_Button_Satoshi object and reset animation
  const objects = runtimeScene.getObjects("Mint_Button_Miggles");
  if (objects.length > 0) {
    objects[0].setAnimation("Idle"); // Reset to Idle state
  }
      
      // Detailed error handling
      const errorMessage = error.message.toLowerCase();
      if (errorMessage.includes("insufficient funds")) {
        alert("Insufficient funds for transaction.");
      } else if (errorMessage.includes("user rejected")) {
        alert("Transaction was rejected in your wallet.");
      } else if (errorMessage.includes("token id does not exist")) {
        alert("The requested token ID does not exist. It may need to be created by the contract owner first.");
      } else {
        alert("Error minting NFT: " + error.message);
      }
    }
  }
